import React from 'react'
import { useEffect, useState } from 'react'

const XXXX = () => {
    const [members, setMembers] = useState([])

    useEffect(() => {
        fetch('/server/api')
        .then(response => response.json())
        .then(members => {
            setMembers(members);
        })
        .catch(error => {
            console.error(error);
        })
    }, [])

    return (
        <>
            test
            <ul>
                {members.map(members => (
                    <li key={members.id}>{members.name}ccc</li>
                ))}
            </ul>
        </>
    )
}

export default XXXX
